	(158, 'BRKM6', 36.000, NULL, -4.281, -13.006, 0.366, NULL, 0.349, 3.840, 0.000, -0.740, 2.410, 2.030, 25.35, 11.35, 1.260, 33.380, 303.790, 1361.790, -180548391.360, 3.94, 11.37, NULL, 50371559424.000, 65227020, 80497827840.000, '2021-06-30', 14, 14, 'BRASKEM PNB N1', '2021-11-08', 'PNB N1', 4400.000, 1362.000, 1760.000, -8.409, -2.768, 16104371200.000, 8701560000.000, -548494000.000, 2494211000.000, 83844100000.000, 26421500000.000, 87934100000.000, 39039400000.000, 13570400000.000, 34110100000.000, 20539700000.000, NULL, 'Braskem S.A., juntamente com suas subsidiárias, produz e vende resinas termoplásticas. A empresa opera através de três segmentos: Brasil, Estados Unidos e Europa e México. O segmento Brasil produz e vende produtos químicos, incluindo etileno, polímero e propileno de grau químico, butadieno, buteno-1, benzeno, tolueno e produtos xilenos; Combustíveis, tais como gasolina automotiva, gás de petróleo liquefeito, éter etílico terciarino-butílico e éter metil-terciário; intermediários, como cumene; alifáticos, aromáticos e solventes hidrogenados; e especialidades compreendendo isopreno, diciclopentadieno, piperylene, nonene, tetrâmero, poliisobutileno e resinas de hidrocarbonetos. Este segmento também produz e vende polietileno (PE) e polipropileno (pp); fornece eletricidade e outras entradas para produtores de segunda geração; produz e vende de PE, incluindo a produção de PE verde de recursos renováveis; e produz e vende cloreto de polivinilo e refrigerante cáustica. O segmento dos Estados Unidos e da Europa produz e vende pp nos Estados Unidos e na Alemanha. O segmento do México produz e vende etileno, PE de alta densidade e PE de baixa densidade no México. Também fabrica, vende, importações e exporta produtos químicos, petroquímicos e combustíveis; produz, suprimentos e vende serviços públicos, como vapor, água, ar comprimido e gases industriais; e fornece serviços industriais. A empresa era anteriormente conhecida como Copene Petroquímica do Norde