	(175, 'GGBR3', 19.770, NULL, 7.358, 0.979, 0.559, 8.43, 0.512, 1.980, 0.000, -14.060, 3.780, 3.110, 19.19, 13.47, 2.580, 21.650, 13.300, 2383760.000, 61649002293.807, 0.44, 10.70, NULL, 37329715200.000, 3052384131, 51067666432.000, '2021-06-30', 31, 62, 'GERDAU S.A. ON N1', '2021-11-08', 'ON N1', 2990.000, 2383760.000, 1570.000, 2.687, 20.197, 15567190016.000, 4937810000.000, 8201756000.000, 3916551000.000, 61315400000.000, 19130100000.000, 66892000000.000, 28314400000.000, 5637810000.000, 15806200000.000, 10168300000.000, 1.740, 'Gerdau S.a. fornece produtos e serviços de aço. Ele opera através de quatro segmentos: Brasil Negócios, North America Negócios, Negócios da América do Sul e Negócios Especiais de Aço. A empresa oferece produtos semi-acabados, incluindo boletos, flores e lajes; produtos comuns longos laminados, como vergalhões, hastes de arame, barras mercantis, formas de luz e perfis para as indústrias de construção e manufatura; produtos industriais acabados, incluindo barras de aço laminadas comerciais e perfis de luz e fios; produtos agrícolas que incluem estacas e produtos de arame suave; e produtos desenhados compreendem fios de fios farpados e barbless, fios galvanizados, cercas, malhas de arame de reforço de concreto, pregos e grampos. Também produz produtos de aço especiais utilizados em autopeças, veículos leves e pesados ??e máquinas agrícolas, bem como o petróleo e gás, energia eólica, máquinas e equipamentos, mineração e ferroviários, e outros mercados. Além disso, a empresa oferece produtos planas, incluindo bobinas laminadas a quente e pratos pesados; e revende produtos de aço plana, bem como minas e produz minério de ferro. Ele vende seus produtos através de distribuidores independentes, vendas diretas das fábricas e sua rede de varejo. A empresa foi fundada em 1901 e é baseada em São Paulo, Brasil. A Gerdau S.a. é uma subsidiária da Metalårgica Gerdau S.A.', '2021-08-17', 17.12, 3.280, 5336640000.000, 7199451136.000, 5930559000.000, 13.376, 20.088, 16670534656.000, 35913583000.000, 3.73, 19.060, 0.710, 8201756160.000, 'S', 'N', NULL),
