	(181, 'BNBR3', 67.980, NULL, 4.203, 0.846, 0.000, 7.04, 0.000, 0.000, NULL, 0.000, 0.000, 0.000, 0.00, 0.00, 0.000, 0.000, 20.130, 4832.440, 6939759033.050, 0.00, 18.60, NULL, 5871535104.000, 86369123, 7946279936.000, '2021-06-30', 11, 10, 'BANCO DO NORDESTE ON', '2021-11-08', 'ON', 7730.000, 4832.000, 5990.000, 16.176, 80.350, NULL, 747135000.000, 1397107000.000, 334003000.000, 2941470000.000, 710633000.000, 62807700000.000, NULL, 0.000, 0.000, 6939950000.000, 4.783, 'O Banco do Nordeste do Brasil S.a. opera como um banco de desenvolvimento regional no Brasil. Oferece depósitos de demanda, poupança e tempo; e empréstimos de curto prazo para microcrédito urbano, crédito direto ao consumidor, empréstimos de capital de giro, cartões de crédito, contas garantidas, empréstimos de troca e desconto e empréstimos a longo prazo. A empresa também oferece gerenciamento de portfólio, análise de crédito, custódia de títulos, transações cambiais, transferências eletrônicas, coleta e serviços bancários de Internet; e serviços de gestão de ativos de terceiros, como gestão de fundos de investimento para investidores pequenos, médios e grandes. Além disso, está envolvido nas operações de mercado e atividades de gestão de fundos; e estruturação e distribuição de títulos locais de curto e longo prazo compreendendo debêntures, notas promissórias, certificados de recebíveis imobiliários, fundos de investimento de direitos de crédito e outros produtos. A empresa atende aos indivíduos; empresas corporativas, grandes, médias, micro e de pequeno porte; agronegócio, pequenos e mini produtores rurais e agricultores; setores de microfinanças urbanas e rurais; e agências governamentais. Em 31 de dezembro de 2020, operou através de 978 pontos de serviço físicos, incluindo 292 filiais, 471 unidades de microcrédito urbano e 215 unidades de microcrédito rural. O Banco do Nordeste do Brasil S.a. foi fundado em 1952 e está sediado em Fortaleza, Brasil.', '2021-11-01', 17.43, NULL, NULL, -1494283008.