	(184, 'RAPT4', 10.430, NULL, 4.346, 1.573, 0.539, 6.12, 0.428, 1.390, 0.000, -5.260, 5.870, 4.890, 13.78, 15.07, 2.080, 15.600, 36.200, 43498800.000, 2392225633.980, 1.61, 27.46, NULL, 3378829824.000, 360818346, 6928903680.000, '2021-06-30', 23, 48, 'RANDON S.A. IMPLEMENTOS E PARTICIPAÇÕES PN N1', '2021-11-06', 'PN N1', 1577.000, 43498800.000, 1081.000, 2.400, 6.630, 1698608000.000, 272826000.000, 862621000.000, 122146000.000, 7288790000.000, 2113800000.000, 9168900000.000, 5444150000.000, 1713590000.000, 3676730000.000, 1963140000.000, 0.649, 'Randon S.A. Implementos e Participação desenvolve e vende soluções de transporte. Opera através de três segmentos: veículos e reboques, autopeças e serviços. A empresa fabrica e vende corpos de caminhões, reboques e semi-reboques nas áreas de grãos, petroleiros, cargas secas, lixeiras, silos, reefers, canos de açúcar, silvicultura, secadoras, camas baixas e vans; e funil, gôndola, tanque, cargas gerais, plataforma, cortina, telescópica e outros carros de trem. Também desenvolve, fabrica e vende caminhões off-road rígidos e articulados, retroescavadores e mini-carregadores; vende peças e componentes de reposição; e produz e vende peças de material de firction para o sistema de freio, extremidades da roda, acoplamentos e conjuntos de articulação, revestimentos de freio e almofadas, materiais de fricção, fluidos, atuadores, cubos de rodas, suspensões, discos e tambores, eixos e outros produtos de não atrito. Além disso, a empresa vende e gerencia planos de pagamento de cooperação para trailers, máquinas agrícolas e equipamentos, microônibus, caminhões, imóveis e mercados de veículos sob a marca Racon; e fornece produtos e serviços financeiros. Ele opera a rede de vendas e serviços em aproximadamente 100 países, incluindo o Chile, o México, o Canadá, os Estados Unidos, a África do Sul e os países da Ásia, além da União Européia e do Mercosul. A empresa era anteriormente conhecida como Randon Participa, e mudou seu nome para Rand