	(204, 'BRKM5', 56.520, NULL, -82.032, 104.473, 0.555, NULL, 0.529, 5.820, 0.000, -1.120, 3.160, 2.660, 25.35, 11.35, 1.260, 33.380, -127.360, 198160000.000, 430675272.272, 3.94, 11.37, NULL, 45104316416.000, 796072592, 89588080640.000, '2021-06-30', 14, 14, 'BRASKEM PNA N1', '2021-11-08', 'PNA N1', 7017.000, 198160000.000, 1982.000, -0.689, 0.541, 16104371200.000, 8701560000.000, -548494000.000, 2494211000.000, 83844100000.000, 26421500000.000, 87934100000.000, 39039400000.000, 13570400000.000, 34110100000.000, 20539700000.000, NULL, 'Braskem S.A., juntamente com suas subsidiárias, produz e vende resinas termoplásticas. A empresa opera através de três segmentos: Brasil, Estados Unidos e Europa e México. O segmento Brasil produz e vende produtos químicos, incluindo etileno, polímero e propileno de grau químico, butadieno, buteno-1, benzeno, tolueno e produtos xilenos; Combustíveis, tais como gasolina automotiva, gás de petróleo liquefeito, éter etílico terciarino-butílico e éter metil-terciário; intermediários, como cumene; alifáticos, aromáticos e solventes hidrogenados; e especialidades compreendendo isopreno, diciclopentadieno, piperylene, nonene, tetrâmero, poliisobutileno e resinas de hidrocarbonetos. Este segmento também produz e vende polietileno (PE) e polipropileno (pp); fornece eletricidade e outras entradas para produtores de segunda geração; produz e vende de PE, incluindo a produção de PE verde de recursos renováveis; e produz e vende cloreto de polivinilo e refrigerante cáustica. O segmento dos Estados Unidos e da Europa produz e vende pp nos Estados Unidos e na Alemanha. O segmento do México produz e vende etileno, PE de alta densidade e PE de baixa densidade no México. Também fabrica, vende, importações e exporta produtos químicos, petroquímicos e combustíveis; produz, suprimentos e vende serviços públicos, como vapor, água, ar comprimido e gases industriais; e fornece serviços industriais. A empresa era anteriormente conhecida como Copene Petroquímica do Nordeste S.A. e mudou seu nome para a Braskem S.a. Em 2002. A Braskem S.a. foi fundada em 1972 e está sediada em Camañari, Brasil.', '2019-10-04', 0.00, 5.563, 3624803072.000, 6455367168.000, 11212080000.000, -0.799, 86.187, 62438830080.000, 430211000.000, 3.35, 54.690, 1.830, -548494016.000, 'S', 'N', NULL),
