A. Implementares e Participação em novembro de 2003. A Randon S.a. Implementares e Participação foi fundada em 1949 e é baseada em Caxias do Sul, Brasil.', '2021-07-26', 23.36, 4.232, 133517752.000, 75229000.000, 1364745000.000, 11.840, 16.765, 3881096960.000, 2283579000.000, 3.00, 12.660, 0.380, 865964032.000, 'S', 'N', NULL),
